  JWILLIAMS, Amanda Jane and WALLACE, Duncan Ross
  01> WALLACE, William Duncan Anthony
  b 09.11.1997
  64> WILLIAMS, Christina Mary
  b 21.04.1969
  Christina b, at Hastings. She completed a Diploma in Business Studies at Massey
  University and has recently spent 18 months in London working for the Hong Kong and
  Shanghai Bank as a purchasing officer. Back in New Zealand, she is now an
  Information Technology Manager for Boots Healthcare in Wellington.
  04> WILLIAMS, Caroline Margaret m on 22.02.1966 to INGLE, Michael Peter
  b 19.02.1940
  b 18.07.1933
  Caroline b. at Napier and m, at Havelock North. Michael, s/o Louis Sobaux
  Ingle and Doreen Joyce Knox-Homan, b. at Southsea, Hampshire, England.
  Address: 23 Kopanga Road, Havelock North.
  Caroline was educated at Woodford House and trained as a Karitane nurse at
  Christchurch. Michael joined the 7th Gurkha Rifles in 1952 and served in
  Malaysia, Brunei, Sarawak, Nepal and Hong Kong. They lived in Hong Kong for
  three years whilst in the Army and Michael retired as a Major in 1969. He then worked for the Brewers
  Society in London. For many years they let their spare bedrooms to visitors for bed and breakfast.
  Caroline was a member of the voluntary staff at a local hospital and was involved in several village
  activities. They moved out to New Zealand in October 1996 and now live at Havelock North,
  01> INGLE, Victoria Louise
  b 13.07.1967
  Victoria b. at Hong Kong. Address: Basement, 8 Minford Gardens, London W14 OAN,
  England.
  Victoria was educated at St Mary's, Shaftsbury, and trained in cordon bleu cooking
  and secretarial work. She has lived in London for twelve years, excluding a year
  spent travelling around the world in 1989. She has worked for the same marketing
  company since 1987 (returning there after her travelling) and has built up, and now
  manages, their ever-growing It department.
  02> INGLE, Alexandra Caroline
  b 25.03.1969
  Alexandra b. at Hong Kong. She was educated at St Mary's, Shaftesbury. She lived
  in London for four years working in interior design, followed by three years in
  Sydney working with the Victim's Compensation Tribunal. She now lives in New
  Zealand.
